import React from 'react'
import '../style/PopUpLogin.css'

const PopUpLogin = (props) => {
  return (props.trigger)? (
    <div className='popup'>
      <div className='popup-inner'>
        <div className='form'>
            <div>
              <input type="text" />
            </div>
            <div>
              <input type="password" />
            </div>
        </div>
            {props.children}
      </div>
    </div>
  ): "";
}

export default PopUpLogin
